import React from 'react';
import { BrowserRouter } from 'react-router-dom'
import Navbar from './componets/layout/navbar.js'

class App extends Component {
  render () {
    return (
      <BrowserRouter>
        <div className="App">
          <Navbar/>
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
